import React from 'react'
import {Link, NavLink} from 'react-router-dom'
import { connect } from 'react-redux'
import { signOut } from "../../store/actions/authActions"


const SignedInLinks = () => {
    return (
        <ul className="navbar-nav">
            <li><Link to='/' className="navbar-brand js-scroll-trigger" >Project Tools </Link></li>
            <li><NavLink to='/create' className="nav-link">New Project</NavLink></li>
            <li><a onClick={props.signOut}>Log Out</a></li>
            <li><NavLink to='/signup' className="nav-link">Sign Up</NavLink></li>
            <li><NavLink to='/signin' className="nav-link">Login</NavLink></li>
            <li><NavLink to='/' className="nav-link" id="logoIn">PT</NavLink></li>
        </ul>
    )
}

const mapDispatchToProps = (dispatch) => {
    return {
        signOut: () => dispatch(signOut())
    }
}

export default connect(mapDispatchToProps)(SignedInLinks)
